import React from 'react';
import Editor from '../components/item/Editor';
import Responsive from '../components/commons/Responsive';
import TagBox from '../components/item/TagBox';
import InputActionButtons from '../components/item/InputActionButtons';
import InputItemContainer from '../container/item/InputItemContainer';

const ItemInputPage = () => {
  return (
    <Responsive>
      <InputItemContainer />
      <TagBox />
      <InputActionButtons />
    </Responsive>
  );
};

export default ItemInputPage;
